import React from 'react';
import { NavLink } from 'react-router-dom';

export default class Home extends React.Component {
  render() {
    return (
      <div>
        <NavLink to="/game">Play Game</NavLink>
        <NavLink to="/rules">Rules</NavLink>
      </div>
    )
  }
}
